import React, { useState } from 'react';
import './css/Study.css';
import Category from './components/Category'; // Import the Category component

const StudyLesson = () => {
    const [quizResult, setQuizResult] = useState('');
    
    const categories = [
        {
            title: 'Ice Breaker',
            lessons: [
                { title: 'Around the World', description: 'Learn about different cultures.' },
                { title: 'True or False', description: 'Challenge yourself with fun facts.' },
            ]
        },
        {
            title: 'Math',
            lessons: [
                { title: 'Basic Arithmetic', description: 'Learn addition, subtraction, etc.' },
                { title: 'Algebra Basics', description: 'Introduction to variables and equations.' },
            ]
        }
    ];

    const checkAnswer = (answer) => {
        setQuizResult(answer === 'run' ? 'Correct!' : 'Try again.');
    };

    const handleLogout = () => {
        alert("You have logged out.");
        window.location.href = "/";
    };

    return (
        <div>
            {/* Header section */}
            <header>
                <div className="container">
                    <a href="/" className="logo">LearnLinguaAI</a>
                    <nav>
                        <ul>
                            <li><a href="/">Home</a></li>
                            <li><a href="/classes">Classes</a></li>
                            <li><a href="/about">About</a></li>
                            <li className="dropdown">
                                <a href="#" className="dropbtn">See More</a>
                                <div className="dropdown-content">
                                    <a href="/user-profile">Profile</a>
                                    <a href="/contact">Contact</a>
                                    <a href="/setting">Setting</a>
                                    <a href="#" onClick={handleLogout} id="logout-link">Logout</a>
                                </div>
                            </li>
                        </ul>
                    </nav>
                </div>
            </header>

            {/* Main content */}
            <main>
                <section id="lesson-intro">
                    <h2>Welcome to Your English Study</h2>
                    <p>Today's lesson covers basic grammar and vocabulary.</p>
                </section>

                <section id="vocabulary-section">
                    <h2>Vocabulary</h2>
                    <ul id="vocabulary-list">
                        <li><span>Apple</span>: A fruit.</li>
                        <li><span>Book</span>: A collection of written words.</li>
                        <li><span>Run</span>: To move swiftly on foot.</li>
                    </ul>
                </section>

                <section id="quiz-section">
                    <h2>Quick Quiz</h2>
                    <p>Match the words with their meanings:</p>
                    <div id="quiz">
                        <p>1. Which word means "to move swiftly on foot"?</p>
                        <button onClick={() => checkAnswer('run')}>Run</button>
                        <button onClick={() => checkAnswer('apple')}>Apple</button>
                        <button onClick={() => checkAnswer('book')}>Book</button>
                        <p id="quiz-result">{quizResult}</p>
                    </div>
                </section>

                {/* Render each category using the Category component */}
                {categories.map((category, index) => (
                    <Category 
                        key={index} 
                        title={category.title} 
                        lessons={category.lessons} 
                    />
                ))}
            </main>

            {/* Footer section */}
            <footer>
                <div className="container">
                    <p>&copy; 2024 LearnLinguaAI. All Rights Reserved.</p>
                </div>
            </footer>
        </div>
    );
};

export default StudyLesson;
